import { GET_PROFILES } from "../actions/types";

const initialState = {
  profiles: [],
  profile: {}
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_PROFILE:
      return {
        ...state,
        profiles: action.payload
      };

    case GET_PROFILE:
      return {
        ...state,
        project: action.payload
      };
    default:
      return state;
  }
}
